        [HttpPost]
        public async Task<JsonResult> SendOtpMigrant(Applicant obj)
        {
            Message msg = new Message();
            string smsBody = "";
            try
            {
                DataTable dtOTP = new ApplicantDAL().OtpGetByMobileNo(obj.contactNumber);
                DataRow dr = dtOTP.Rows[0];
                string otp = dr["otpCode"].TooString();
                smsBody = "Dear Candidate, Your OTP is : " + otp + ".";
                Message msgSms = await FunctionUI.SendSmsAsync(obj.contactNumber, smsBody, 0);
                msgSms.msg = "OTP Sent to your mobile number";
            }
            catch (Exception)
            {
            }
            return Json(msg, JsonRequestBehavior.AllowGet);
        }

        [HttpPost]
        public async Task<JsonResult> LoggedInUserMigrantAsync(LoginUser login)
        {
            Message msg = new Message();


            Applicant app = ProjFunctions.CookieApplicantGet();
            if (app == null)
            {
                try
                {
                    app = new ApplicantDAL().LoginMigrant(login.emailId, login.password);

                    if (app != null && app.applicantId > 0)
                    {
                        string otp = "";
                        try
                        {
                            DataTable dtOTP = new ApplicantDAL().OtpGetByMobileNo(app.contactNumber);
                            DataRow dr = dtOTP.Rows[0];
                            otp = dr["otpCode"].TooString();
                        }
                        catch (Exception)
                        {
                            otp = "";
                        }

                        if (!String.IsNullOrEmpty(otp))
                        {


                            #region Email Process

                            try
                            {
                                string path = ProjConstant.Email.Path.registration;
                                string filePath = Path.Combine(Server.MapPath(path));
                                string body = filePath.ReadFile();
                                body = body.Replace("{#name#}", app.name).Replace("{#otp#}", otp);

                                //obj.emailId.SendEmail(ProjConstant.Email.Subject.registration, ProjConstant.Email.Title.registration, body);
                            }
                            catch (Exception)
                            {
                            }

                            #endregion

                            #region SMS Process
                            string smsBody = "";
                            try
                            {

                                smsBody = "Dear "+app.name+" , Your OTP is : " + otp + ".";
                                int smsId = 0;
                                try
                                {
                                    SMS sms = new SMSDAL().GetByTypeForApplicant(app.applicantId, ProjConstant.SMSType.registration);
                                    smsBody = sms.detail;
                                    smsId = sms.smsId;
                                }
                                catch (Exception)
                                {
                                    smsBody = "";
                                }
                                if (String.IsNullOrWhiteSpace(smsBody))
                                {
                                    smsId = 0;
                                    smsBody = "Dear " + app.name + " , Your OTP is : " + otp + ".";

                                }
                                //Message msgSms = await FunctionUI.SendSmsAsync(app.contactNumber, smsBody, 0);
                                Message msgSms = await FunctionUI.SendSmsAsync("03006647709", smsBody, 0);
                                try
                                {
                                    SmsProcess objProcess = msgSms.status.SmsProcessMakeDefaultObject(app.applicantId, smsId);
                                    new SMSDAL().AddUpdateSmsProcess(objProcess);
                                }
                                catch (Exception)
                                {
                                }
                            }
                            catch (Exception)
                            {
                            }
                            #endregion

                            msg.value = app.contactNumber.TooString();
                            msg.msg = smsBody;
                        }

                        //ProjFunctions.CookieApplicantSet(app);
                        msg.id = app.applicantId;
                        msg.status = true;
                    }
                    else
                    {
                        msg.id = app.applicantId;
                        msg.status = false;
                        msg.message = app.emailId;
                    }
                }
                catch (Exception ex)
                {
                    msg.id = 0;
                    msg.status = false;
                    msg.msg = ex.Message;
                }
            }
            else
            {
                msg.id = app.applicantId;
                msg.status = true;
            }
            return Json(msg, JsonRequestBehavior.AllowGet);
        }

