        public ActionResult GiveConsent()
        {
            MeritData model = new MeritData();
            int appId = loggedInUser.applicantId;
            DataTable dt = new ApplicantDAL().GetApplicantMeritByApplicantId(appId);
            model.consents = new List<Consent>();
            model.listOfMerits = new List<MeritDataItem>();
            if (dt.Rows.Count>0)
            {
                foreach(DataRow dr in dt.Rows)
                {
                    MeritDataItem mdi = new MeritDataItem();
                    mdi.applicantId = dr["applicantId"].TooInt();
                    mdi.prefNo = dr["prefNo"].TooInt();
                    mdi.typeId = dr["typeId"].TooInt();
                    mdi.specialityJobId = dr["specialityJobId"].TooInt();
                    mdi.nam = dr["nam"].TooString();
                    mdi.fname = dr["fname"].TooString();
                    mdi.contactNumber = dr["contactNumber"].TooString();
                    mdi.cnic = dr["cnic"].TooString();
                    mdi.matric = dr["matric"].TooDecimal();
                    mdi.fa = dr["fa"].TooDecimal();
                    mdi.firstName = dr["firstName"].TooString();
                    model.listOfMerits.Add(mdi);
                }
                
                DataTable dtConsents = new ApplicantDAL().GetApplicantConsentByApplicantId(appId);
                if(dtConsents.Rows.Count>0)
                {
                    
                    foreach(DataRow dr in dtConsents.Rows)
                    {
                        Consent c = new Consent();
                        c.applicantId = dr["applicantId"].TooInt();
                        c.roundId = dr["roundId"].TooInt();
                        c.prefNo = dr["prefNo"].TooInt();
                        c.typeId = dr["typeId"].TooInt();
                        c.consentTypeId = dr["consentTypeId"].TooInt();
                        c.dated = Convert.ToDateTime(dr["dated"]);
                        c.consentId = dr["consentId"].TooInt();
                        c.firstName = dr["firstName"].TooString();
                        c.upgradable = dr["upgradable"].TooInt();
                        model.consents.Add(c);
                    }
                    
                }
            }
            
            return View(model);
        }
